import LocationTrade from './components/LocationTrade/LocationTrade';

import './App.css';
import './assets/SemanticUI/semantic.css';

function App() {
  return (
   <>   
   <div class="ui equal width form" id="demo-form">
        <div class="fields">
            <LocationTitle></LocationTitle>
        </div>
        <div class="fields">
            <LocationCity></LocationCity>
        </div>
        <div class="fields">
            <LocationZone></LocationZone>
        </div>
        <div class="fields">
            <LocationNeighborhood></LocationNeighborhood>
        </div>

        <div class="fields">
            <LocationTrade></LocationTrade>
        </div>
    </div>
    </>
    );
}

export default App;
